import './Topbar.css';

const Topbar = () => {
    return (
        <div class = "topbar">
            <div class = "logo"></div>
            <div class = "sub_menu">
                Q&A
            </div>
            <div class = "sub_menu">
                About Us
            </div>
        </div>
    );
}

export default Topbar;
